const container=document.querySelector('.lesson-detail');


window.addEventListener('DOMContentLoaded',function(){
    let updateLessonDetail=lessonDetail.map((item)=>{
        return ` <div class="lessons">
            <div>
               <h3>${item.date}</h3>
               <h5>${item.time}</h5>
            </div>
            <div>
                <h3>${item.topic}</h3>
                <h5>${item.teacher}</h5>
            </div>
            <div>
                <img class="teacher-img" src='${item.img}' alt="image"/>
            </div>
           </div>`;
    })
    updateLessonDetail=updateLessonDetail.join('');

    container.innerHTML=updateLessonDetail;
});


